import React from 'react';
import {useLocation, useParams, useNavigation} from 'react-router-dom';

const Show = () => {
    const {id} = useParams();
    const location = useLocation();
    const navigate = useNavigation();


    return (
        <div>
            <div>Show id: {id}</div>
            <div></div>
        </div>
    );
};

export default Show;
